   "source": [
    "# Calculate TotalActiveMinutes for each user\n",
    "# Print summary statistics for TotalActiveMinutes\n",
    "user_averages_with_clusters %>% \n",
    "  mutate(TotalActiveMinutes = AvgVeryActiveMinutes + AvgFairlyActiveMinutes + AvgLightlyActiveMinutes) %>%\n",
    "  group_by(Cluster) %>%\n",
    "  summarize(median(TotalActiveMinutes))\n",
    "\n",
    "\n",
    "# Threshold Recommendation and Explanation\n",
    "# I will be using 265 minutes for cluster 1\n",
    "# I will be using 92 for cluster 2.\n",
    "\n",
    "# Here's why:\n",
    "# Data-Driven Decision: This threshold represents the median value of total active minutes across all users in the dataset. \n",
    "# Using the median means that approximately 50% of users are already meeting this goal, while 50% are not.\n",
    "# Balanced Approach: At 245 minutes (about 4 hours) of total active time per day, this threshold strikes \n",
    "# a balance between being too lenient (e.g., using the 25th percentile of ~170 minutes) \n",
    "# and too strict (e.g., using the 75th percentile of ~287 minutes).\n",
    "\n",
    "# Realistic Yet Challenging: For users below this threshold, it represents an achievable goal \n",
    "# that's grounded in real user behavior rather than an arbitrary number. \n",
    "# For those already above it, it validates their current activity levels.\n",
    "\n",
    "# Contextual Relevance: This threshold aligns with the observed behavior patterns in your \n",
    "# specific user base, making it more relevant than generic guidelines that might not \n",
    "# account for the unique characteristics of your users.\n",
    "\n",
    "# When implementing this threshold in your predictive models, it will create a meaningful \n",
    "# binary outcome variable that can help identify which factors most strongly predict \n",
    "# whether a user meets this activity goal.\n",
    "\n",
    "activity_goal_threshold_c1 <- 265  \n",
    "activity_goal_threshold_c2 <- 92\n",
    "# Creating a binary outcome variable for whether users meet the activity goal\n",
    "# First, a new variable called TotalActiveMinutes is computed by summing the three types of active minutes.\n",
    "# Then, another variable, ActivityGoalMet, is created. \n",
    "# This is a binary variable where a value of 1 means the users total active minutes meet or exceed the defined threshold, \n",
    "# and 0 means they do not (taking care to ensure that there are no missing values).\n",
    "user_averages_with_clusters <- user_averages_with_clusters %>%\n",
    "  mutate(\n",
    "    TotalActiveMinutes = AvgVeryActiveMinutes + AvgFairlyActiveMinutes + AvgLightlyActiveMinutes,\n",
    "    ActivityGoalMet = ifelse(Cluster == 1 & !is.na(TotalActiveMinutes) & TotalActiveMinutes >= activity_goal_threshold_c1 |\n",
    "                               Cluster == 2 & !is.na(TotalActiveMinutes) & TotalActiveMinutes >= activity_goal_threshold_c2, 1, 0)\n",
    "  )"
   ]
  },
